import React from 'react';
import StatContainer from './StatContainer';
import './AggregatedStatsContainer.css';

const AggregatedStatsContainer = ({ data }) => {

    return (
        <div className='AggregatedStatsContainer'>
            <div className='AggregatedStatsContainer-row'>
                <StatContainer name='Number of Posts' value={data.n_posts}/>
                <StatContainer name='Total Views' value={data.total_views}/>
                <StatContainer name='Total Engagement' value={data.total_engagements}/>
            </div>
            <div className='AggregatedStatsContainer-row'>
                <StatContainer name='Average Views' value={data.avg_views}/>
                <StatContainer name='Average Engagement' value={data.avg_engagements}/>
                <StatContainer name='Average Engagement' value={data.avg_engagements}/>
            </div>
        </div>
    )
}

export default AggregatedStatsContainer;
